import React, { useState, useEffect } from "react";
import "../style/SoundPage.css";

export default function MusicInsights() {
  const [featureRows, setFeatureRows] = useState([]);
  const [filteredFeatureRows, setFilteredFeatureRows] = useState([]);
  const [selectedFeature, setSelectedFeature] = useState("All");
  const [error, setError] = useState("");
  const [rowsPerPage, setRowsPerPage] = useState(5);
  const [currentPage, setCurrentPage] = useState(1);

  useEffect(() => {
    fetchSongsByFeatures();
  }, []);

  const fetchSongsByFeatures = async () => {
    try {
      const response = await fetch("http://localhost:8080/songs/audio-features");
      if (!response.ok) throw new Error(`Failed to fetch songs. Status: ${response.status}`);
      const data = await response.json();

      setFeatureRows(data || []);
      setFilteredFeatureRows(data || []);
    } catch (err) {
      console.error(err);
      setError("Failed to load songs by features.");
    }
  };

  const handleFeatureChange = (event) => {
    const feature = event.target.value;
    setSelectedFeature(feature);
    setCurrentPage(1);

    if (feature === "All") {
      setFilteredFeatureRows(featureRows);
    } else {
      const filtered = featureRows.filter((row) =>
        Object.entries(row).some(([key, value]) => key === feature && value > 0)
      );
      setFilteredFeatureRows(filtered);
    }
  };

  const handleRowsPerPageChange = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setCurrentPage(1);
  };

  const indexOfLastRow = currentPage * rowsPerPage;
  const indexOfFirstRow = indexOfLastRow - rowsPerPage;
  const paginatedRows = filteredFeatureRows.slice(indexOfFirstRow, indexOfLastRow);

  const totalPages = Math.ceil(filteredFeatureRows.length / rowsPerPage);

  const handlePreviousPage = () => {
    if (currentPage > 1) setCurrentPage((prev) => prev - 1);
  };

  const handleNextPage = () => {
    if (currentPage < totalPages) setCurrentPage((prev) => prev + 1);
  };

  return (
    <div id="sound-page-wrapper">
      <div id="navbar">
        <ul>
          <li>
            <a href="http://localhost:3000/">HomePage</a>
          </li>
          <li>
            <a href="http://localhost:3000/search">Search Page</a>
          </li>
          <li>
            <a href="http://localhost:3000/genre">Genre Page</a>
          </li>
          <li>
            <a href="http://localhost:3000/collaboration">Collaboration</a>
          </li>
        </ul>
      </div>

      <h1>Search Songs by Audio Features</h1>

      <section className="table-section">
        <div className="controls">
          <label htmlFor="featureFilter">Filter by Feature: </label>
          <select id="featureFilter" value={selectedFeature} onChange={handleFeatureChange}>
            <option value="All">All</option>
            <option value="instrumentalness">Instrumentalness</option>
            <option value="energy">Energy</option>
            <option value="valence">Valence</option>
            <option value="liveness">Liveness</option>
            <option value="acousticness">Acousticness</option>
          </select>

          <div className="rows-per-page">
            <label htmlFor="rowsPerPage">Rows per page:</label>
            <select id="rowsPerPage" value={rowsPerPage} onChange={handleRowsPerPageChange}>
              <option value={5}>5</option>
              <option value={10}>10</option>
              <option value={25}>25</option>
            </select>
          </div>
        </div>

        {filteredFeatureRows.length === 0 && !error ? (
          <div className="info-message">No songs available for the selected feature.</div>
        ) : error ? (
          <div className="error-message">{error}</div>
        ) : (
          <>
            <table className="data-table">
              <thead>
                <tr>
                  <th>Track Title</th>
                  <th>Instrumentalness</th>
                  <th>Energy</th>
                  <th>Valence</th>
                  <th>Liveness</th>
                  <th>Acousticness</th>
                </tr>
              </thead>
              <tbody>
                {paginatedRows.map((row, index) => (
                  <tr key={index}>
                    <td>{row.title || "Unknown Title"}</td>
                    <td>{row.instrumentalness?.toFixed(3) || "N/A"}</td>
                    <td>{row.energy?.toFixed(3) || "N/A"}</td>
                    <td>{row.valence?.toFixed(3) || "N/A"}</td>
                    <td>{row.liveness?.toFixed(3) || "N/A"}</td>
                    <td>{row.acousticness?.toFixed(3) || "N/A"}</td>
                  </tr>
                ))}
              </tbody>
            </table>
            <div className="pagination-controls">
              <button disabled={currentPage === 1} onClick={handlePreviousPage}>
                Previous
              </button>
              <span>
                Page {currentPage} of {totalPages}
              </span>
              <button disabled={currentPage === totalPages} onClick={handleNextPage}>
                Next
              </button>
            </div>
          </>
        )}
      </section>
    </div>
  );
}
